descricao:
O Fundo de Investimento Imobiliário – FII RBR Rendimento High Grade tem o objetivo de aplicar, nos seguintes Ativos Alvo:
I. CRI, desde que tenham sido objeto de oferta pública registrada na CVM ou cujo registro tenha sido
dispensado nos termos da regulamentação em vigor;
II. letras hipotecárias;
III. letras de crédito imobiliário;
IV. letras imobiliárias garantidas;
V. cotas de fundos de investimento imobiliário;
VI. certificados de potencial adicional de construção emitidos com base na Instrução da CVM nº 401, de
29 de dezembro de 2003; e
VII demais títulos e valores mobiliários que sejam ou venham a ser permitidos pela legislação ou
regulamentação aplicável. 
O Fundo deverá manter, no mínimo, 67% (sessenta e sete por cento) do seu patrimônio líquido investido em
CRI, observados os limites de aplicação por emissor previstos na legislação aplicável. O Fundo tem prazo de duração indeterminado. As Cotas de emissão do Fundo são destinadas aos Investidores Institucionais e aos Investidores Não
Institucionais.
